import React from "react";
import Container from "@mui/material/Container";
import Input from "@mui/joy/Input";
import Grid from "@mui/joy/Grid";
import Typography from "@mui/material/Typography";
import Button from "@mui/joy/Button";
import { useNavigate, redirect, Form } from "react-router-dom";
import Divider from "@mui/material/Divider";
import TextField from "@mui/material/TextField";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import HomeIcon from "@mui/icons-material/Home";
import ShareIcon from "@mui/icons-material/Share";
import ModeIcon from "@mui/icons-material/Mode";
import ClearIcon from "@mui/icons-material/Clear";
import PersonIcon from "@mui/icons-material/Person";

export default function Appartamenti() {
  const navigate = useNavigate();
  return (
    <div style={{ width: "100%", height: "100%", backgroundColor: "red" }}>
      <Container
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          height: "100vh",
          width: "100vw",
        }}
      >
        <Container
          style={{
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            height: "95vh",
            width: "100vw",
            backgroundColor: "rgb(203, 231, 253)",
            borderRadius: "5vh",
          }}
        >
          <Grid
            container
            spacing={1}
            justifyContent="center"
            alignItems="center"
            sx={{ flexGrow: 1 }}
          >
            <Grid
              container
              direction="column"
              sx={{ flexGrow: 1 }}
              style={{
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
                height: "90vh",
                width: "35vw",
              }}
            >
              <Grid
                style={{
                  height: "10%",
                }}
              >
                <Typography
                  variant="h4"
                  color="rgb(0, 76, 134)"
                  sx={{ fontWeight: "bold" }}
                >
                  I miei appartamenti
                </Typography>
              </Grid>
              <Grid
                container
                style={{
                  height: "90%",
                  width: "90%",
                  ////backgroundColor: "rgb(44, 135, 50)",
                  overflow: "auto",
                }}
              >
                <Grid
                  style={{
                    height: "30%",
                    width: "100%",
                    marginTop: "10px",
                    backgroundColor: "rgb(172, 219, 255)",
                  }}
                >
                  <Grid
                    container
                    direction="column"
                    alignItems="center"
                    style={{
                      height: "100%",
                      width: "100%",
                    }}
                  >
                    <Grid
                      container
                      direction="row"
                      style={{
                        height: "45%",
                        width: "100%",
                        //backgroundColor: "rgb(13, 231, 93)",
                      }}
                    >
                      <Grid
                        container
                        style={{
                          height: "100%",
                          width: "20%",
                          //backgroundColor: "rgb(83, 51, 33)",
                        }}
                      >
                        <Grid
                          sx={{
                            height: "100%",
                            width: "80%",
                            borderRadius: "50%",
                            border: "1px solid black",
                          }}
                        />
                      </Grid>
                      <Grid
                        container
                        style={{
                          height: "100%",
                          width: "2%",
                          //backgroundColor: "rgb(83, 91, 153)",
                        }}
                      ></Grid>

                      <Grid
                        container
                        direction="column"
                        justifyContent="flex-start"
                        style={{
                          height: "100%",
                          width: "58%",
                          //backgroundColor: "rgb(133, 191, 153)",
                        }}
                      >
                        <Typography
                          style={{
                            height: "70%",
                            width: "100%",
                            //backgroundColor: "rgb(83, 71, 153)",
                            fontSize: "200%",
                          }}
                        >
                          Appartamento 1
                        </Typography>
                        <Typography
                          style={{
                            height: "30%",
                            width: "100%",
                            //backgroundColor: "rgb(13, 11, 153)",
                          }}
                        >
                          Codice:12345
                        </Typography>
                      </Grid>
                      <Grid
                        container
                        direction="column"
                        style={{
                          height: "100%",
                          width: "20%",
                          //backgroundColor: "rgb(103, 11, 153)",
                        }}
                      >
                        <Grid
                          container
                          justifyContent="flex-end"
                          style={{
                            height: "40%",
                            width: "100%",
                            //backgroundColor: "rgb(43, 111, 113)",
                          }}
                        >
                          <ShareIcon
                            sx={{
                              borderRadius: "50%",
                              border: "1px solid black",
                              //backgroundColor: "rgb(43, 111, 113)",
                            }}
                          ></ShareIcon>
